import React from 'react';
import './App.css';
import {Link} from "react-router-dom" 


function Nav() {


    
  return (
    <nav> 
        <h3>Logo
            <ul  className = "nav-links">
                <Link to = "/about">
                <li> About </li> 
                </Link>
            <Link>
        <li>Shop</li>
        </Link>
            </ul>
         </h3>
     </nav>

  );
}

export default Nav;
